import * as React from "react";
import "./notificaion.css";
import { Box, Paper, TextField } from "@mui/material";
import Navbars from "../Navbar/navbarHome2.js";
import Drawer from "../Drawer/Drawer";
import { LocalizationProvider } from "@mui/x-date-pickers/LocalizationProvider";
import { DatePicker } from "@mui/x-date-pickers/DatePicker";
import { AdapterLuxon } from "@mui/x-date-pickers/AdapterLuxon";

const Matching = () => {
  const [value, setValue] = React.useState(new Date());
  const [value2, setValue2] = React.useState(new Date());

  return (
    <div className="App-body-Order">
      <header className="App-header">
        <Navbars />
      </header>

      <Box sx={{ display: "flex", width: "100% " }}>
        <Drawer />

        <div style={{ marginTop: 60, height: 100 }}>
          <h4
            style={{
              fontWeight: 500,
              fontSize: 36,
              color: " #333333",
              marginLeft: 20,
              position: "absolute",
              top: "13%",
            }}
          >
            Translate
          </h4>
        </div>

        <div className="bodyNotificaion">
          <div style={{ margin: 30 }}>
            <div
              style={{
                textAlign: "left",
                float: "left",
                borderBottom: "2px solid #FFC100",
                marginBottom: 10,
                width: "10%",
              }}
            >
              <div
                style={{
                  color: "#FFC100",
                  float: "left",
                  margin: 5,
                  fontWeight: 700,
                }}
              >
                <p className="headerNotificaion">View All</p>
              </div>
            </div>

            <div
              style={{
                textAlign: "left",
                float: "left",
                borderBottom: "2px solid #8B8B8B",
                marginBottom: 10,
                width: "20%",
              }}
            >
              <div
                style={{
                  color: "#8B8B8B",
                  float: "left",
                  margin: 5,
                  fontWeight: 700,
                }}
              >
                <p className="headerNotificaion">Chat</p>
              </div>
            </div>

            <div
              style={{
                textAlign: "left",
                float: "left",
                borderBottom: "2px solid #8B8B8B",
                marginBottom: 10,
                width: "20%",
              }}
            >
              <div
                style={{
                  color: "#8B8B8B",
                  float: "left",
                  margin: 5,
                  fontWeight: 700,
                }}
              >
                <p className="headerNotificaion">Money</p>
              </div>
            </div>

            <div
              style={{
                textAlign: "left",
                float: "left",
                borderBottom: "2px solid #8B8B8B",
                marginBottom: 10,
                width: "46.5%",
              }}
            >
              <div
                style={{
                  color: "#8B8B8B",
                  float: "left",
                  margin: 5,
                  fontWeight: 700,
                }}
              >
                <p className="headerNotificaion">Work</p>
              </div>
            </div>
          </div>

        </div>
      </Box>
    </div>
  );
};

export default Matching;
